import { Container } from "react-bootstrap";
import image from "../home.jpg";
import "./Home.css";
function Home() {
  return (
    <Container>
      <section style={{ backgroundColor: "#f7ede3" }} className="p-3 mt-3 home">
        <div className="center">
          <img
            src="../home.jpg"
            className="img-fluid shadow-4 image"
            alt="..."
          />
        </div>
        <article>
          <div className="title">
            <h1>OUR PARTNER</h1>
          </div>
          <div className="ourpartner"></div>
        </article>
      </section>
    </Container>
  );
}

export default Home;
